import { styled } from '@mui/system'
import { Box,Paper, Stack,Button } from '@mui/material'
import React from 'react'
import Theme from '../../Component/Theme'; //**** Special import*/
import {ThemeProvider} from '@mui/material';
import img1 from '/media/nipuna/SSD FILES/FinalProject/FrontEnd/medi-ward-sri-lanka/src/Assest/mainlogo.png'
import Image from 'next/image';

const theme=Theme();

const DemoPaper = styled(Paper)(({ theme }) => ({

    width: 1000,
    height:800,
    textAlign: 'center',
    borderRadius:theme.shape.borderRadius*6
  }));



const Login = () => {

  return (
    <ThemeProvider theme={theme}>
        <Stack bgcolor="white" display="flex" direction="row" justifyContent="center"  alignItems="center" sx={{
            marginTop:6,
            marginBottom:6,
        }}>
            <DemoPaper elevation={6}>
                <Stack display="flex" direction="row" justifyContent="space-between">
                    <Box flex="40%" sx={{
                        backgroundColor:theme.palette.primary.dark,
                        height:800,
                        borderTopLeftRadius:"30px",
                        borderBottomLeftRadius:"30px"
                    }}>
                    <Image src={img1} alt='Main_Logo' width="400px" height="400px"></Image>
                    </Box>
                    <Box flex="55%" sx={{ 
                        height:800,
                        borderTopRightRadius:"30px",
                        borderBottomRightRadius:"30px",
                        display:"flex",
                        justifyContent:"flex-end"
                    }}><Button variant="contained" sx={{
                        backgroundColor:"#242a41",
                        height:"50px",
                        borderTopRightRadius:theme.shape.borderRadius*6,
                        fontSize:"26px"
                        }}>X</Button></Box>
                </Stack>

            </DemoPaper>
        </Stack>
    </ThemeProvider>
  )
}

export default Login
